parser = argparse.ArgumentParser()
parser.add_argument(
    '--color',
    default = 'white',
    help = 'color de las celular'
)

parser.add_argument(
    'n',
    help = 'numero de casillas'
)

parser.add_argument(
    '--game',
    default = ' ',
    help = 'juego inicial'
)

args = parser.parse_args()
color = args.color
n = int(args.n)

fps = n * .75

tk = Tk()
tk.overrideredirect(True)
width = 600
canvas = Canvas(tk, bg = 'black', width = width, height = width)
canvas.pack()
pixel = int(width / n)

def random_game(n):
    m = []
    for y in range(n + 2):
        lista = []
        for x in range(n + 2):
            if y == 0 or x == 0 or y == n + 1 or x == n + 1:
                lista.append(0)
            else:
                lista.append(random.randint(0, 1))
        m.append(lista)
    return m

def iterar(n):
    vecinos = 0
    new_matriz = random_game(n)
    for y in range(1, n + 1):
        for x in range(1, n + 1):
            for i in range(-1, 2):
                for j in range(-1, 2):
                    if matriz[y + i][x + j] == 1: vecinos += 1
            vecinos -= matriz[y][x]
            if vecinos == 3 and matriz[y][x] == 0: new_matriz[y][x] = 1 #resucitar
            elif vecinos > 3 and matriz[y][x] == 1: new_matriz[y][x] = 0 #sobrepoblacion
            elif vecinos < 2 and matriz[y][x] == 1: new_matriz[y][x] = 0 #soledad
            else: new_matriz[y][x] = matriz[y][x]
            #print(vecinos, ' ', end = "")
            vecinos = 0
        #print('')
    return new_matriz

def dibujar(n):
    for y in range(n):
        for x in range(n):
            #canvas.create_rectangle(pixel * x, pixel * y, (pixel * x) + pixel, (pixel * y) + pixel, outline = 'white')
            if matriz[y + 1][x + 1] == 1: canvas.create_rectangle(pixel * x, pixel * y, (pixel * x) + pixel, (pixel * y) + pixel, fill = color)

if args.game == 'glider': matriz = glider
else: matriz = random_game(n)

matriz_previa = []
while True:
    dibujar(n)
    matriz = iterar(n)
    if matriz == matriz_previa:
        matriz = random_game(n)
    time.sleep(1 / fps)
    tk.update()
    canvas.delete(ALL)
    matriz_previa = matriz

tk.mainloop()









    